<item>
<title>2009-03-02 12:24:34</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaCountriesCodes/show&amp;time=2009-03-02+12%3A24%3A34</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaCountriesCodes&amp;amp;v=15rh" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Destinations&amp;nbsp;/&amp;nbsp;Форма&amp;nbsp;Countries&amp;nbsp;Codes&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaCountriesCodes&amp;amp;time=2009-03-02+12%3A24%3A34">2009-03-02 12:24:34&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaCountriesCodes&amp;amp;time=2009-03-02+12%3A28%3A23">2009-03-02 12:28:23&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Для&amp;nbsp;того чтобы добавить новую страну достаточно заполнить поля с&amp;nbsp;названием страны (Country name) и&amp;nbsp;кодом страны (Country code). &lt;br />
Для&amp;nbsp;того чтобы закончить операцию добавления новой страны, нужно нажать кнопку “Add new”. &lt;br />
Под&amp;nbsp;формой расположены кнопки со&amp;nbsp;стрелками для&amp;nbsp;навигации по&amp;nbsp;списку уже&amp;nbsp;добавленных в&amp;nbsp;систему стран. &lt;br />
Ниже отображается список со&amp;nbsp;странами. Если необходимо произвести какие-нибудь действия с&amp;nbsp;одной из&amp;nbsp;стран, например, изменить ее&amp;nbsp;код или&amp;nbsp;длину фильтра номеров, предварительно нужно: &lt;br />
&lt;div class="indent">&lt;!--notypo-->2.&lt;!--/notypo--> Выбрать эту&amp;nbsp;страну (поставить точку в&amp;nbsp;начале записи). &lt;br />
&lt;!--notypo-->3.&lt;!--/notypo--> Внести необходимые изменения в&amp;nbsp;форме.&lt;br />
&lt;!--notypo-->4.&lt;!--/notypo--> Нажать на&amp;nbsp;кнопку “Save changes” для&amp;nbsp;сохранения изменений.&lt;/div>&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">Для&amp;nbsp;того чтобы добавить новую страну достаточно заполнить поля с&amp;nbsp;названием страны (Country name) и&amp;nbsp;кодом страны (Country code). Также, если в&amp;nbsp;стране используется одна стандартная длина телефонных номеров, то&amp;nbsp;дополнительно в&amp;nbsp;поле “Num count” можно указать длину номера для&amp;nbsp;этой страны. &lt;br />
Использование фильтра на&amp;nbsp;длину номера позволит не&amp;nbsp;пропускать неправильные номера на&amp;nbsp;это направление и&amp;nbsp;тем самым улучшить показатели статистики. Для&amp;nbsp;того чтобы закончить операцию добавления новой страны, нужно нажать кнопку “Add new”. &lt;br />
Под&amp;nbsp;формой для&amp;nbsp;добавления новых стран расположены кнопки со&amp;nbsp;стрелками для&amp;nbsp;навигации по&amp;nbsp;списку уже&amp;nbsp;добавленных в&amp;nbsp;систему стран. Так&amp;nbsp;как количество одновременно выводимых стран на&amp;nbsp;экран ограничено 20 строками, то&amp;nbsp;список может занимать не&amp;nbsp;одну страницу. Здесь же&amp;nbsp;расположено окно для&amp;nbsp;поиска конкретной страны в&amp;nbsp;списке по&amp;nbsp;ее названию. Поиск работает динамически, подстраиваясь под&amp;nbsp;текст который вы&amp;nbsp;вводите в&amp;nbsp;строку. &lt;br />
Ниже отображается список со&amp;nbsp;странами. Если вам&amp;nbsp;необходимо произвести какие-нибудь действия с&amp;nbsp;одной из&amp;nbsp;стран, например, изменить ее&amp;nbsp;код или&amp;nbsp;длину фильтра номеров, предварительно нужно: &lt;br />
&lt;div class="indent">&lt;!--notypo-->2.&lt;!--/notypo--> Активировать ее&amp;nbsp;запись, поставив галочку в&amp;nbsp;поле “chk”. &lt;br />
&lt;!--notypo-->3.&lt;!--/notypo--> Внести необходимые изменения.&lt;br />
&lt;!--notypo-->4.&lt;!--/notypo--> Нажать на&amp;nbsp;кнопку “Save changes” для&amp;nbsp;сохранения внесенных изменений.&lt;/div>&lt;/div>&lt;/div>
</description>
</item>
